import React from 'react';

const SearchBar = ({getQuery, search, updateSearch}) => {
  return (
    <form
      className="search__form"
      onSubmit={getQuery}
    >
      <input
        type="text"
        className="search__bar"
        value={search}
        onChange={updateSearch}
      />
      <button
        type=""
        className="search__button">
        Search
      </button>
    </form>
  );
}

export default SearchBar;
